ata that may be used for interferometry.</Description></Additional_Attributes><Additional_Attributes><Name>BEAM_MODE_TYPE</Name><DataType>STRING</DataType><Description>In most cases, the BEAM_MODE_TYPE value is the same as the BEAM_MODE attribute. Each platform has its own scheme for defining acquisition sensor beam modes. Beam modes often reflect a set configuration of polarization, resolution, and off-nadir pointing angle.</Description></Additional_Attributes><Additional_Attributes><Name>INSAR_BASELINE</Name><DataType>FLOAT</DataType><Description>The perpendicular distance between two satellites when they took the related two images. Useful for identifying image pairs to use for interferometry.</Description></Additional_Attributes><Additional_Attributes><Name>CENTER_FRAME_ID</Name><DataType>STRING</DataType><Description>ID of the center frame</Description></Additional_Attributes><Additional_Attributes><Name>CENTER_ESA_FRAME</Name><DataType>INT</DataType><Description>The European Space Agency equivalent to the value in the FRAME_NUMBER field</Description></Additional_Attributes><Additional_Attributes><Name>ACQUISITION_DATE</Name><DataType>STRING</DataType><Description>Date the data was acquired by the satellite or aircraft and instrument.</Description></Additional_Attributes><Additional_Attributes><Name>MISSION_NAME</Name><DataType>STRING</DataType><Description>The sitenames where AIRSAR, AIRMOSS, and UAVSAR acquisitions were taken.</Description></Additional_Attributes><Additional_Attributes><Name>CENTER_LON</Name><DataType>FLOAT</DataType><Description>Longitude of the center of the scene or frame.</Description></Additional_Attributes><Additional_Attributes><Name>NEAR_END_LAT</Name><DataType>FLOAT</DataType><Description>Latitude of the granule where imaging ended nearest to the satellite. For an ascending satellite, it locates the upper left corner of a north-oriented image.</Description></Additional_Attributes><Additional_Attributes><Name>FARADAY_ROTATION</Name><DataType>STRING</DataType><Description>An effect of the ionosphere that rotates polarizations from HH or VV or HV or VH. Significant for L or P band. Rotation over 5 degrees reduces usefulness for applications such as forest biomass. Effect is reduced at solar minimum.</Description></Additional_Attributes><Additional_Attributes><Name>FAR_END_LON</Name><DataType>FLOAT</DataType><Description>Longitude of the granule where imaging ended farthest from the satellite. For an ascending satellite, it locates the upper right corner of a north-oriented image.</Description></Additional_Attributes><Additional_Attributes><Name>BYTES</Name><DataType>FLOAT</DataType><Description>Product size in bytes.</Description></Additional_Attributes><Additional_Attributes><Name>CENTER_LAT</Name><DataType>FLOAT</DataType><Description>Latitude of the center of the scene or frame.</Description></Additional_Attributes><Additional_Attributes><Name>ARCHIVE_DATATAKE_ID</Name><DataType>STRING</DataType><Description>The ARCHIVE_DATATAKE_ID for this collection</Description></Additional_Attributes><Additional_Attributes><Name>DEM_REGION</Name><DataType>STRING</DataType><Description>The DEM_REGION for this collection</Description></Additional_Attributes><Product_Level_Id>2</Product_Level_Id></DIF>"